import React, { Component } from 'react';

class Counter extends Component {
    state={
        count: 11
    }
    render() { 
        return(
            <div>
                <h1>{this.state.count}</h1>
                <button>Increament</button>
            </div>
        );
    }

    formatCount(){
        return this.state.count===0? 'Zero' : this.state.count;
    }
}

export default Counter;
